import React, { Component } from 'react';
import { Form } from 'react-bootstrap';

class OurLabel extends Component {
    render() {
        const { name } = this.PaymentResponse;

        return (
            <Form.Label>{ name }</Form.Label>
        )
    }
}

export default OurLabel;
